import React from 'react'
import {  Route, Switch } from 'react-router-dom'

import { TeacherPage, StudentPage } from '../pages'

import './App.css'

export default class App extends React.Component {
  render() {
    console.log('Route', Route)
    console.log('Switch', Switch)
    console.log('App', App)
    return (
      <Switch>
        <Route exact path="/" component={TeacherPage}/>
        <Route exact path="/live/:uuid/teacher" component={TeacherPage}/>
        <Route exact path="/live/:uuid/student" component={StudentPage}/>
        {/* <Route exact path="/404" component={PageNotFound}/>
        <RedirectRoute redirectPath="/404"/> */}
      </Switch>
    )
  }
}
